import React from "react";

function NavItem(props) {
  console.log(props.activeIndex, props.value);
  let Class = "NavItem";
  if (props.value === props.activeIndex) {
    Class = "NavItem active";
  }
  return <div className={Class}>{props.value}</div>;
}

class Header extends React.Component {
  render() {
    const numbers = this.props.numbers;
    const activeIndex = 2;
    const NavItemList = numbers.map((number) => (
      <NavItem key={number.toString()} value={number} active={activeIndex} />
    ));
    return <div className="navBar">{NavItemList}</div>;
  }
}

export default Header;
